import React from 'react';
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  align-items: center;
  flex-direction: column;
  font-size: 15px;
`;

function App() {
  return (
    <Container>
      Kwanyoung Lee
    </Container>
  );
}

export default App;
